import React from 'react';
import Styled from 'styled-components';


export default function HeaderMain(props){
    console.log(props);
    const HeaderSection = Styled.header`
        display: flex;
        flex-wrap: wrap;
        height: 100px;
        width: 100%;
        background-color: #213047;
        justify-content: space-around;
        box-shadow: 0 10px 15px -3px rgba(0,0,0,.1), 0 4px 6px -2px rgba(0,0,0,.05);
    `;

    const HeaderLeftDiv = Styled.div`
        height: 100%;
        width: 30%;
        display: flex;
        flex-wrap: wrap;
        align-content: center;
        
    `;

    const HeaderTitle = Styled.h1`
        font-size: 20px;
        letter-spacing: 3px;
        color: #fff;
        height: 20px;    
    `;

    const HeaderRightDiv = Styled.div`
    height: 100%;
    width:40%;
    display: flex;
    flex-wrap: wrap;
    align-content: center;
    justify-content: space-between;    
    `;

    const HeaderLinks = Styled.div`
        height: 20px;
        font-size: 15px;
        line-height: 20px;
        letter-spacing: 2px;
        color: #fff;    
    `;

    return(
        <HeaderSection>

            <HeaderLeftDiv>

                <HeaderTitle>School in the Cloud</HeaderTitle>

            </HeaderLeftDiv>

            <HeaderRightDiv>

                {props.links.forEach((item)=>{
                   <HeaderLinks>item</HeaderLinks>
                })}

                <HeaderLinks>RESOURCES</HeaderLinks>

                <HeaderLinks>SUPPORT</HeaderLinks>

                <HeaderLinks>PROFILE</HeaderLinks>

            </HeaderRightDiv>


        </HeaderSection>
    )
}
